import Head from "./head";

function FirstComponent(){



    return(
        <div className="firstSection">
            <Head/>
            <hr/>
            <button><img src="/images/download.svg" className="downloadsvg"/>получить коммерческое</button>
        </div>
    );
}

export default FirstComponent;
